import { Link } from 'react-router-dom';
import styled from 'styled-components';

const MakeRoomComponent = () => {
  return (
    <StyledLink to="../pages/MakeRoom">
      <MakeRoomButton>
        <MakeRoomButtonFont>방만들기</MakeRoomButtonFont>
      </MakeRoomButton>
    </StyledLink>
    // <Link to="../pages/MakeRoom">
    //   <MakeRoomButton>
    //     <MakeRoomButtonFont>방만들기</MakeRoomButtonFont>
    //   </MakeRoomButton>
    // </Link>
  );
};
export default MakeRoomComponent;

const StyledLink = styled(Link)``;

const MakeRoomButton = styled(Link)`
  margin: 20px;
  padding: 30px;
  border-radius: 10px;
  background-color: rgba(10, 10, 35, 0.8);
  //background-color: #0a0a23;
  flex-basis: 30%;
  &:hover {
    background-color: rgba(125, 125, 160, 0.8);
  }
  //반응형
  @media screen and (max-width: 900px) {
    width: 90%;
  }
`;
const MakeRoomButtonFont = styled.div`
  color: #ffffff;
  font-size: 20px;
  font-weight: 700;
`;
